export default {
  name: "tp-organization-serviceType",
  props: {
    itemParam: {
      type: Object
    }
  },
  data: function data() {
    return {
      tableData: [{
        code: "1",
        serviceType: "男装定制",
        serviceArea: "北京市北京市朝阳区"
      }, {
        code: "2",
        serviceType: "女装搭配",
        serviceArea: "北京市北京市海淀区"
      }],
      classDialogVisible: false,
      filtersData: {
        code: "",
        // 新增新增职位编码
        name: "",
        //职位名称
        parentId: null,
        //父级职位  已有职位选择 如果为1及职位则为NULL
