      },
      editDisabled: true,
      //可编辑状态  除使用状态其他都不可编辑
      showDisabled: true //查看时 使用状态不可编辑

    };
  },
  methods: {
    getValidOptions: function getValidOptions() {
      var arr = [{
        status_id: true,
        status_name: "使用中"
      }, {
        status_id: false,
        status_name: "未使用"
      }];
      return arr;
    },
    //关闭
    closeDialog: function closeDialog(formName) {
      this.$refs[formName].resetFields(); //重置选项

      this.classDialogVisible = false;
    },
    //查看服务类型
    getClassData: function getClassData() {
      var _this = this;

      console.log(this.itemParam.id);
      this.getAxios("USER", "/position/get", {
        id: this.itemParam.id
      }).then(function (data) {
        if (data) {
          _this.filtersData = data;
        }
      });
      this.classDialogVisible = true;
    }
  }
};
